import { createStore } from "vuex";

export default createStore({
  state: {
    personalInfo: {
      name: "",
      email: "",
      phone: "",
      complete: false,
    },
    Plan: {
      plan: "",
      yearly: false,
      complete: false,
    },
    "Add Ons": {
      online: false,
      storage: false,
      custom: false,
      complete: false,
    },
    "Finish Up": {}
  },
  getters: {},
  mutations: {},
  actions: {},
  modules: {},
});
